import React, { useState } from 'react';

const Slidehome = () => {
    const [name, setName] = useState('')
    return (
        <>        <input
            type="text"
            name="firstName"
            onChange={(event) => setName(event.target.value)}
            value={name} />
        </>

    );
}

export default Slidehome;
